import React, { Component, Fragment} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <Fragment>
      <div className="App">
       <h1>React App</h1>
       <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Dicta eum eveniet molestias perspiciatis cumque nobis distinctio. Ab, laborum. Necessitatibus consequatur officiis iste qui adipisci, soluta a dolorum sapiente quae temporibus!</p>
      </div>
      <div>
        <h2>mon second titre</h2>
      </div>
      </Fragment>
    );
  }
}

export default App;
